import React from 'react';

class app extends Component {
constructor(){
  super(props);
  this.state = {
    items: [],
    isLoaded: false,
  }
}
componentWillMount() {
  fetch ('https://reqres.in/api/users')
  .then(res => res.json())
  .then(json => {
    this.setState({
      isLoaded: true,
      items: json,
    })
  })
}
render() {
